import React, { Component } from 'react';
import { Container} from 'reactstrap';

class Menu extends Component {
    render() {
        return (
            <div>
                <div className="container"> ISP HackerEarth</div>
                <div></div>
            </div>
        );
    }
}

export default Menu;
